/*-----------------------------------------------------------------------------------------------------------
	CPF Progression
-----------------------------------------------------------------------------------------------------------*/

CPFEffectiveDate, 
CPFCareerId,
CPFProgPolicyId, 
CPFProgCurrent, 
CPFProgAccountNo, 
CPFProgSchemeId,
CPFMAWOption,
CPFMAWLimit,
CPFProgRemarks,
CPFMAWPeriodOrdWage,
CPFMedisavePaidByER)
Select CPFProgression.EmployeeSysId, 
'2012-09-01', 
'',
'Year2012Sep', 
0, 
CPFProgAccountNo, 
CPFProgSchemeId,
CPFMAWOption,
CPFMAWLimit,
'',
CPFMAWPeriodOrdWage,
CPFMedisavePaidByER
From PayEmployee join CPFProgression 
On PayEmployee.EmployeeSysId = CPFProgression.EmployeeSysId
Where CPFProgCurrent = 1 and CPFEffectiveDate < '2012-09-01' and CPFProgSchemeId != ''
And (LastPayDate = '1899-12-30' Or LastPayDate >= '2012-09-01')
And Not exists(Select * From CPFProgression as CheckCPF where CheckCPF.CPFEffectiveDate = '2012-09-01' and CheckCPF.EmployeeSysID = CPFProgression.EmployeeSysId)
;

